descript:
Развитие режима ТОСЭР и СПВ на территории края с:
- созданием не менее 9 объектов инфраструктуры к 01.01.2018 и не менее 14 объектов инфраструктуры к 01.01.2020;
- объемом осуществленных инвестиций в ТОСЭР "Хабаровск" и "Николаевск" и СПВ в размере 11,0 млрд.рублей к 01.01.2018, 52,6 млрд. рублей к 01.01.2020;
- созданием 458 новых рабочих мест к 01.01.2018 и 1002 ново-го рабочего места к 01.01.2020.
